import styled from "styled-components";

const AvatarBig = styled.div`
  border-radius: 50%;
  text-align: center;
  width: 70px;
  height: 70px;
  border: 5px #566573 solid;
  margin-right: 15px;
  padding: 0;
`;

export default AvatarBig;
